import React from "react";

const LeftMenu = () => {
  return (
    <ul className="sidebar-menu">
      <li className="menu-header"></li>
      <li className="dropdown active" style={{ marginTop: "5px" }}>
        <a href="/dashboard" className="nav-link" style={{ color: "black" }}>
          <i data-feather="monitor"></i>
          <span>Dashboard</span>
        </a>
      </li>

       Include your other menu items here 
       You may need to convert your PHP code to React JSX 
     For example:
          {user.tbl_role_id === 1 && (
            <ul className="sidebar-menu">
              <li className="menu-header"></li>
              <li className="dropdown active">
                <a href="/admin/users" className="nav-link" style={{ color: "black" }}>
                  <i data-feather="user-check"></i>
                  <span>Users</span>
                </a>                  
              </li>
               Include other admin menu items here 
            </ul>
          )}
          {uniqueParentNames.map((parentName) => (
            <ul className="sidebar-menu">
              <li className="menu-header"></li>
              <li className="dropdown active">
                <a href={`/${parentName}`} className="nav-link" style={{ color: "black" }}>
                  <i data-feather="command"></i>
                  <span>{parentName}</span>
                </a>
              </li>
            </ul>
          ))}
      
    </ul>
  );
};

const Cart = () => {
  return (
    <div>
      <LeftMenu />
      {/* Include other content of your Cart component here */}
      <div>Heyyyyyyyyyyyyyyyy</div>
    </div>
  );
};

export default Cart;
